import React from "react";

const DeviceItem = ({ device }) => {
  return (
    <>
      <div className="Name">
        <img src={"http://localhost:5000/" + device.img} alt="phone" />
        <img 
          alt="close"
        />
        <div>
          {device.producer} {device.name}
        </div>
      </div>
    </>
  );
};

export default DeviceItem;
